import React from 'react';

const CollectionItem = (items)=>
{
    return(
        <div className='preview'>
        {
            items.filter((item,index)=>index<4).map((item)=>(
                <div key={item.id}>{item.name}</div>
            ))
        }
    </div>
    );
}
export default CollectionItem;
